// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.7;

contract test {

    event Transfer(address to, address from, uint256 amount);

    uint256[100] private array;

    constructor () {
        for(uint i;i<100;) {
            array[i] = gasleft() % 100;
            unchecked{++i;}
        }
    }

    function testing (uint aux, uint aux2, uint8 num) external returns (uint) {
        if(num == 1)
            return aux + aux2 + 1;
        else
            return aux + aux2 + 2;
    }

}

